INSERT INTO `vgpic_albums` VALUES (7,'凌静世界',0,0,'文学创作一定离不开个人的生活体验，创作《寂寞的公因数》这本书的初衷，是有感于现代都市疏离的人际关系，以及人们内心普遍的越来越强烈的孤独感。生活节奏的加快和社会的进步，给人们的精神生活带来了很大的影响，选择的增多意味着无从选择。我给这本书中的主人公身份定位是因纽特人，也是希望能从局外人的角度来对现代都市生活和人们的情感关系做一个冷静的审视和反思，希望通过这个故事给人们带来启发。','2022-05-11','group1/M00/00/04/wKixgWJ78HmAAzdcAAK06weWZ309081424;group1/M00/00/04/wKixgWJ78HmAFdArABx2X1oFyjA4834659;group1/M00/00/04/wKixgWJ78HmAWQXiAAwvQku8HdQ1355840;group1/M00/00/04/wKixgWJ78HmAPPRkAA78RI8IDZs2041498;group1/M00/00/04/wKixgWJ78HmAL1_nAM01cVRehWs4663786;group1/M00/00/04/wKixgWJ78HmAIQwwAAflcskQ2Oc5647003;group1/M00/00/04/wKixgWJ78HmAPOK7AAbu48Gx0zE3538416;group1/M00/00/04/wKixgWJ78HmAax3nAANIINv2g909399328;group1/M00/00/04/wKixgWJ78HmAJMV-ABKoMMrxbzk1054958;group1/M00/00/04/wKixgWJ78HmAdGtjAAZoQTi9aSo6973573;group1/M00/00/04/wKixgWJ78HmAOc7lAA13FKQQJ983738123;group1/M00/00/04/wKixgWJ78HmAZo_PAEPQCz6aCIo6384732','group1/M00/00/04/wKixgWJ78HmAAzdcAAK06weWZ309081424','风景',1,12),(10,'坂本龙一 ·画册',0,0,'坂本龙一： \"音乐即自由\"\n\n自上世纪70年代末起，坂本龙一在日本乃至国际范围内不断探索音乐与艺术间的跨领域合作。从作为YMO成员推动日本电子音乐的发展，到凭借电影配乐荣获奥斯卡、格莱美等多项国际殊荣，亦或是对当下全球气候问题的密切关注，坂本龙一持续挑战着人们对艺术的惯常认知，不断拓展其边界与可能性','2022-05-12','group1/M00/00/05/wKixgWJ9OA6AcDt1AAFZ9SMZe8w0423083;group1/M00/00/05/wKixgWJ9OA6AHuhDAAMEGUn8Zb42175319;group1/M00/00/05/wKixgWJ9OA6ATMGqAAFo0gNrNEw2005080;group1/M00/00/05/wKixgWJ9OA6AFkUiAAEl3PhcKDk9635603;group1/M00/00/05/wKixgWJ9OA6ALraWAAF9QBFcxVs3143906;group1/M00/00/05/wKixgWJ9OA6AdQfkAAcYMZMinJ86231212;group1/M00/00/05/wKixgWJ9OA6APk1CAAGKcJKOIBA3446844;group1/M00/00/05/wKixgWJ9OA6AYp3gAAGkcMSpBDE8301593;group1/M00/00/05/wKixgWJ9OA6AHBxSAAIe_rXhcTQ5499610;group1/M00/00/05/wKixgWJ9OA6AY9jPAAGtXf1Nk_02926501;group1/M00/00/05/wKixgWJ9OA6ACfbYAAUGbfLjMI03713862;group1/M00/00/05/wKixgWJ9OA6AFUU4AAF1ikbtOWo6746617;group1/M00/00/05/wKixgWJ9OA6AF4NgAAEWp3RUiTk3329864;group1/M00/00/05/wKixgWJ9OA6AdCa2ABVZWvOGMUY6434573;group1/M00/00/05/wKixgWJ9OA6AXuF-AAJ4MqvMEqY2269915;group1/M00/00/05/wKixgWJ9OA6AAbPTAASyQOmc4Zg7786952;group1/M00/00/05/wKixgWJ9OA6ANqVvA