02','group1/M00/00/06/wKixgWJ9RpeALCt2AAMCyPbHphg5448492','名画',0,12),(25,'梵高简画手机壁纸',0,0,'作者通过卡通的形式临摹了梵高的画作；\n\n在梵高的作品中，世界充满了灿烂的色彩，他释放了自己的情绪。\n\n\n\n但世界上的一切都被扭曲了，就像一个巨大的漩涡，吞噬着他。\n\n\n\n梵高很孤独，只有绘画陪伴着他，他渴望爱，但他得不到爱，他一生只能在艺术世界里漫步。\n\n\n\n他用生活创造了艺术奇迹，讽刺的是，他自己看不见','2022-05-14','group1/M00/00/17/wKixgWJ_fxKAZpyJAAR3VNZA-k04557101;group1/M00/00/17/wKixgWJ_fxKALzYBAAg8kUOIpnA7917821;group1/M00/00/17/wKixgWJ_fxKAWyyqAAaEd4xQxsA3934480;group1/M00/00/17/wKixgWJ_fxKAZj6XAA9PihBqV5k8797479;group1/M00/00/17/wKixgWJ_fxqAJNQwAAeQCX0RGqI1688158;group1/M00/00/17/wKixgWJ_fx-AWHRuAAtjTWgxGPc9837043;group1/M00/00/17/wKixgWJ_f0KAA682AAPSdtR-WUo2431256;group1/M00/00/17/wKixgWJ_f0uAHBThAAXe5F_AOg46320134;group1/M00/00/17/wKixgWJ_f1qAWscdAASdYhe_Phw8545275','group1/M00/00/17/wKixgWJ_fxKAZpyJAAR3VNZA-k04557101','梵高',0,4),(26,'莫奈知名 ·画册',0,0,'莫奈捕捉着花朵之间的水面，捕捉着水面倒映着的天空，他捕捉着穿梭嬉戏的林间空气，还有时间洒下的光影和流溢的清风，他用自然和色彩纷呈的方式细致地展现水面的粼粼波光，颜料已经成为他思想的载体，色彩已经成为画家自己、自然、时间和整个人生经验的交织倒影。在他所呈现作品的更深层次中，是生命的记忆和体验，是超然的观念和唤醒的自然之神。水中植物弯弯曲曲、星星点点，天空湛蓝澄澈，光影流动自如，物象的世界与精神的内在融通接洽。甚至在视力严重恶化以后，莫奈仍然用心去描绘池中睡莲，在那个时刻，他描绘的不是一个物象，而是一种感知，一种记忆的本质','2022-05-15','group1/M00/00/17/wKixgWKAcaqAZni9AAxt_q24big9012687;group1/M00/00/17/wKixgWKAcaqAfdZwAAXGlbM9C9g2325226;group1/M00/00/17/wKixgWKAcaqAdXslAAavBtkq6mM1722813;group1/M00/00/17/wKixgWKAcaqAcZJZAAvezzi7lHQ5257420;group1/M00/00/17/wKixgWKAcaqANIaRAAzPsKsT42A7438898;group1/M00/00/17/wKixgWKAcaqAUcpxAApOxleGGr01184146;group1/M00/00/17/wKixgWKAcaqAdMKgAAqNLuzTMIE1301991;group1/M00/00/17/wKixgWKAcaqACcy6AAM1uDSpkm84267816;group1/M00/00/17/wKixgWKAcaqAbTyEAAQWsmFPkeM0282850;group1/M00/00/17/wKixgWKAcaqATcstAB3DDmdVIkI2057790;group1/M00/00/17/wKixgWKAcaqAIPj1AAtDHf_LuIw3527773;group1/M00/00/17/wKixgWKAcaqAUh5qAA4GyfwL0ew2553445;group1/M00/00/17/wKixgWKAcaqAAj0lAAi7d23WguU9868053;group1/M00/00/17/wKixgWKAcaqAbYr7AAj1EHdUcsk2307942;group1/M00/00/17/wKixgWKAcaqAULjSAAdpEaVxXp40702579;group1/M00/00/17/wKixgWKAcaqANYWpAAbb3_4hVn40808589;group1/M00/00/17/wKixgWKAcaqAFyFPAAUeqGQdxhg5745903;group1/M00/00/17/wKixgWKAcaqAMVx4AAZRwX7GbZw1239272','group1/M00/00/17/wKixgWKAcaqAZni9AAxt_q24big9012687','名画',0,35),(27,'梵高人物画像',0,0,'个人心中都有一团火, 路过的人只看到烟。\n2.我梦想着绘画,我画着我的梦想。\n3.More and more, I believe, to create the good price is: hard work, disappointment, and perseverance. 我越来越相信,创造美...\n4.只要活着的人还活着,死去的人就不会死去。\n6.每个人心里都有一团火，路过的人只看到烟，但总有一个人，总有那么一个人能到这团火，然后走过来，陪我一起。我带着我的热情，我的冷漠，我的狂暴，我的温和，以及对爱情毫无理由的相信，走的上气不接下气，我结结巴巴地对她说，你叫什么名字。从你叫什么名字开始，后来，有了一切。\n7.我想画出触动人心的素描，我想透过人物或风景所表达的，不是伤感的忧郁，而是真挚的悲伤。\n8.当我画一个太阳，我希望人们感觉它在以惊人的速度旋转，正在发出骇人的光热巨浪。\n9.当我画一片麦田，我希望人们感觉到麦子正朝着它们最后的成熟和绽放努力。\n10.当我画一棵苹果树，我希望人们能感觉到苹果里面的果汁正把苹果皮撑开，果核中的种子正在为结出果实奋进。','2022-05-15','group1/M00/00/17/wKixgWKA7POAaNjcAAD8-VajqrY9638360;group1/M00/00/17/wKixgWKA7PaACRfnAAEw3TTHcvE3728848;group1/M00/00/17/wKixgWKA7PmASMehAAGWmb5Aauw0371432;group1/M00/00/17/wKixgWKA7P2AW6UbAAGyjeOzT2Y5239176;group1/M00/00/17/wKixgWKA7QSAH_-oAAEWGxIijlE2414299;group1/M00/00/17/wKixgWKA7QiAKh7PAAGzfYrQXGc2829073;group1/M00/00/17/wKixgWKA7Q6AE_jaAAGxRrxi5-A9683600;group1/M00/00/17/wKixgWKA7RSAXxGqAAFEtOcN_fw6557987;group1/M00/00/17/wKixgWKA7RqAK-kFAAESLKJNT9E9242159;group1/M00/00/17/wKixgWKA7SOAa7NXAAD4g0c-Ny40769130;group1/M00/00/17/wKixgWKA7SmAJWi7AAFUthbiYRk2288086','group1/M00/00/17/wKixgWKA7POAaNjcAAD8-VajqrY9638360','梵高',0,4),(28,'莫奈 · 名画',0,0,'莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈莫奈','2022-05-17','group1/M00/00/17/wKixgWKC8TuAZFUlAADeJY9xTso6347108;group1/M00/00/17/wKixgWKC8TuACYaiAAE1DPoHOyw7297999;group1/M00/00/18/wKixgWKC8TuAVdLVAACgO-Au45Y5266833;group1/M00/00/18/wKixgWKC8TuAeYRYAAErRHpZRsg1987324;group1/M00/00/18/wKixgWKC8TuAT5eDAAFC63J2pT01667341;group1/M00/00/18/wKixgWKC8TuABOCrAADGiLORvGA0138436;group1/M00/00/18/wKixgWKC8TyAauPTAACo55bm15M3848177;group1/M00/00/18/wKixgWKC8TyASlIEAAChzuesPgQ0663081;group1/M00/00/18/wKixgWKC8TyACCMCAAC-iaBVVPI1837477;group1/M00/00/18/wKixgWK